import base64

from PyQt5 import QtWidgets, QtGui, QtCore
from PyQt5.QtWidgets import QVBoxLayout, QHBoxLayout, QLineEdit, QPushButton, QFileDialog, QLabel, QMessageBox
from Functions.resize import resize

class Recize(QtWidgets.QMainWindow):
    def __init__(self, main_window):
        super(Recize, self).__init__()
        self.main_window = main_window  # Passa a instância da MainWindow
        self.setWindowTitle("Redimensionar Imagens")
        # Converta a imagem do ícone para uma string base64 e use-a diretamente
        icon_data = ""  # Substitua isso pela string base64 da sua imagem de ícone

        icon_bytes = base64.b64decode(icon_data)
        pixmap = QtGui.QPixmap()
        pixmap.loadFromData(icon_bytes)
        self.setWindowIcon(QtGui.QIcon(pixmap))
        self.setFixedSize(1500, 400)
        self.init_ui()

    def init_ui(self):
        widget = QtWidgets.QWidget()
        layout = QVBoxLayout()
        widget.setLayout(layout)
        self.setCentralWidget(widget)

        title = QLabel()
        title.setText("Redimensionar Imagens")
        title.setAlignment(QtCore.Qt.AlignCenter)
        title.setStyleSheet("""
            QLabel {
                font-size: 40px;
                font-weight: Bold;
                color: #333;
                margin: 50px 0;
            }
        """)
        layout.addWidget(title)

        # Adicione uma label e um botão para a pasta
        folder_layout = QHBoxLayout()  # Layout horizontal para a label e o botão
        layout.addLayout(folder_layout)

        self.input_folder = QLineEdit()
        self.input_folder.setPlaceholderText("Selecione a pasta")  # Adicione o placeholder
        self.input_folder.setStyleSheet("""
            QLineEdit {
                border-radius: 10px;
                padding: 10px;
            }
        """)
        folder_layout.addWidget(self.input_folder)

        button = QPushButton()
        folder_icon_data = ""
        folder_icon_bytes = base64.b64decode(folder_icon_data)
        folder_icon_pixmap = QtGui.QPixmap()
        folder_icon_pixmap.loadFromData(folder_icon_bytes)
        button.setIcon(QtGui.QIcon(folder_icon_pixmap))
        button.clicked.connect(self.open_file_dialog)
        button.setStyleSheet("""
            QPushButton {
                background-color: #333;
                color: #fff;
                border-radius: 10px;
                padding: 10px;
            }
            QPushButton:hover {
                background-color: #666;
            }
            QPushButton:pressed {
                background-color: #999;
            }
        """)
        folder_layout.addWidget(button)

        # Adicione uma label e um botão para a largura (L)
        width_layout = QHBoxLayout()  # Layout horizontal para a label e o QLineEdit
        layout.addLayout(width_layout)

        self.input_width = QLineEdit()
        self.input_width.setPlaceholderText("Digite a largura")
        self.input_width.setStyleSheet("""
            QLineEdit {
                border-radius: 10px;
                padding: 10px;
            }
        """)

        # Crie um QIntValidator para permitir apenas números inteiros
        int_validator = QtGui.QIntValidator(self)
        self.input_width.setValidator(int_validator)

        width_layout.addWidget(self.input_width)

        send_button_layout = QHBoxLayout()
        layout.addLayout(send_button_layout)

        send_button = QPushButton()
        send_button.setText("Enviar")
        send_button.clicked.connect(self.send_input_values)
        send_button.setStyleSheet("""
                  QPushButton {
                      background-color: #333;
                      font-weight: bold;
                      font-size: 16px;
                      color: #fff;
                      border-radius: 10px;
                      padding: 10px;
                      margin: 20px auto 0 auto;
                  }
                  QPushButton:hover {
                      background-color: #666;
                  }
                  QPushButton:pressed {
                      background-color: #999;
                  }
               """)
        send_button_layout.addWidget(send_button)

        return_button_layout = QHBoxLayout()
        layout.addLayout(return_button_layout)

        return_button = QPushButton()
        return_button.setText("Voltar")
        return_button.clicked.connect(
            self.return_window)  # Conecta o botão "Voltar" à função que retorna à janela principal
        return_button.setStyleSheet("""
            QPushButton {
                background-color: #333;
                font-weight: bold;
                font-size: 16px;
                color: #fff;
                border-radius: 10px;
                padding: 10px;
                margin: 20px auto 0 auto;
            }
            QPushButton:hover {
                background-color: #666;
            }
            QPushButton:pressed {
                background-color: #999;
            }
        """)
        return_button_layout.addWidget(return_button)

        layout.addStretch(1)

    def open_file_dialog(self):
        options = QFileDialog.Options()
        folder_path = QFileDialog.getExistingDirectory(self, "Selecione uma pasta", options=options)
        if folder_path:
            self.input_folder.setText(folder_path)

    def send_input_values(self):
        folder_value = self.input_folder.text()
        width = self.input_width.text()
        width_value = int(width)
        result = resize(folder_value, width_value)

        if result:
            QMessageBox.information(self, "Concluído", "Imagens redimensionadas com sucesso!")
        else:
            QMessageBox.critical(self, "Erro", "Ocorreu um erro ao redimensionar as imagens.")

    def return_window(self):
        self.main_window.show()  # Mostra a instância existente da MainWindow
        self.close()  # Fecha a janela atual

if __name__ == '__main__':
    app = QtWidgets.QApplication([])
    main_window = MainWindow()  # Cria a instância da MainWindow
    second_window = Recize(main_window)  # Passa a instância da MainWindow para a Recize
    main_window.show()
    app.exec()